import React from 'react';
import './MotivationPage.css'; 

function MotivationPage({ motivationalMessage, thoughts }) {
  return (
    <div className="motivation-page">
      <h1>Motivational Message</h1>
      <p>{motivationalMessage}</p>
      <a href="/thoughts-backlog" className="backlog-button">View Backlog</a>
      <a href="/" className="home-button">Back to Home</a>
    </div>
  );
}

export default MotivationPage;
